import React from "react";
import Insta from "./assets/insta-logo.png";
import Gmail from "./assets/gmail-logo.png";
import Linkedin from "./assets/linkedin.png";
import Github from "./assets/github.png";


const Contact=()=>{
    return(
     <>
     <h1 className="contact-heading">Interested to know more about me? Reach me via</h1>
     
     <div className="container">
           <a href="#" ><img src={Insta} className="logos" /> </a>
           <a href="#" ><img src={Gmail} className="logos" /> </a>
           <a href="www.linkedin.com/in/rishav-sachdeva-554525248" ><img src={Linkedin} className="logos" /> </a>
     <a href="#" ><img src={Github} className="logos" /> </a>
     </div>


     </>

    );
}
export default Contact;
